import './App.css';
import videoPrueba from './video/videoPrueba.mp4'

function App() {
  return (
    <div className="App">
      <video autoPlay loop muted>
        <source src={videoPrueba} type='video/mp4'/>
      </video>
      {/* <h1>Henry Pokemon</h1> */}
    </div>
  );
}

export default App;
